  false,\n\t\"url\": null,\n\t\"notes\": \"Long-running science support for the agency
  (Office of Protected Resources, others) related to the use of modern pesticides
  throughout the United States as a limiting factor for endangered species conservation
  and recovery. This work is currently supporting several national ESA Biological
  Opinions, and is under review by the National Academy of Sciences. The NAS panel
  recommendations are expected in the summer of 2013, and these will guide additional
  research in FY14 and beyond.nnAnalyses of water and tissue samples for pesticides.\",\n\t\"license_title\":
